Wild first event at #fdlb for the @compcamsofficial Corvette team and I. I stuck it in the tire wall twice. That admittedly shook my confidence and negatively affected qualifying. We bounced back and had a great battle with @branden_sorensen in top 32. We got the win there and then battled @jonathancash16 in top 16. He put two solid runs together and I made a mistake on run up making things very difficult for myself in my chase. He took the win but we learned a ton for our new setup on @kendamotorsports tires. Solid start to 2023, we will see everyone at ATL next month!

