I wish my 2019 self could talk to me. I would’ve been over the moon to get to top 16 at @formulad. That being said, I got my very first top 16 at @roadatlanta #fdatl in pro, which was awesome. Unfortunately we had a series of things play out that lead to the blower belt breaking in the burnout box and again in the battle. I really felt strong about our chances to move through the bracket this weekend and I’m proud that we have something to build on. We’re 16th in points, top 16 in both of the first two rounds, but I can’t help but think what might’ve been. We can’t afford to miss opportunities in Pro, and one slipped away this weekend. On to #osw 

