The look pretty much sums up #fdsea for us. Tough first practice, recovered really well and the car was great. Felt awesome about my qualifying lap, but didn’t get a great score, 16TH. For my top 32 battle with @romecp I saw some smoke under the hood in the burnout box, pulled in and had lost a jack shaft belt. We took our 5 min call, it’s a very challenging thing to change quickly, especially when hot. We missed the deadline by about 30 seconds and didn’t get to compete. We’re all gutted. This was my favorite track and I felt confident in the car and my ability here. 

Short term, sucks. A lot. Long term, the changes @lsx_ernie and @ls13coupe made this week were a huge difference and the bigger @kendamotorsports tire put us right where we needed to be. Tired of posts like this but we keep improving and we still believe we can be on the top of that podium. 
